import './App.css';

function App() {
  return (
    <>
      <nav className="topic" id="toipc">
        <ul className="topicinside" id="topicinside">
          <li className="nametopic">Textutils</li>
          <li className="nametopic">Home</li>
          <li className="nametopic">String Method</li>
          <li className="nametopic">Array Method</li>
          <li className="nametopic">Help</li>
        </ul>
      </nav>
    </>
  );
}

export default App;
